import "../CSS/Chart.css";
import ChartBar from "./ChartBar";



function Chart(props) {
  return (
      <div className="chart">
        {props.dataPoints.map(dataPoint => <ChartBar value={dataPoint.value}/>)}
      </div>
    
  );
}

export default Chart;
